// import { response } from "express" ;

 function scraper () {
    const commits = []
    const pushedat = []
     fetch ("https://api.github.com/repos/BrightNate1022/git_scrap")
    .then (response => response.json())
    // .then (console.log (response))
    commits.pop
    pushedat.pop
    .then (data => commits.push(data.commits_url), pushedat.push(data.pushed_at))
    // .then (data => console.log(data.commits_url))
    
    
}

export default scraper
